export const menuList = [
  { label: "Home", path: "/", section: "#" },
  { label: "Project", path: "/Project", section: "#" },
  { label: "Solution", path: "/Solution", section: "#" },
  { label: "About Us", path: "/About", section: "#" },
  { label: "Contact", path: "/Contact", section: "#" },
];

export const solutionList = [
  { imgPath: "/assets/images/solution1.png", label: "3D Art", list: [] },
  {
    imgPath: "/assets/images/solution2.png",
    label: "3D Art",
    list: ["For presentation", "For media", "For game"],
  },
  {
    imgPath: "/assets/images/solution3.png",
    label: "3D Art",
    list: ["NFT", "Online", "Offline", "Website"],
  },
];

export const connectList = [
  { label: "info@newworldhouse.com", imgPath: "/assets/images/icon/mail.png" },
  {
    label: "discord.gg/newworldhouse",
    imgPath: "/assets/images/icon/discord.png",
  },
  { label: "@newworldhouse.line", imgPath: "/assets/images/icon/line.png" },
  { label: "newworldhouse.ig", imgPath: "/assets/images/icon/instagram.png" },
  { label: "@newworldhouse.fb", imgPath: "/assets/images/icon/fb.png" },
];
